import React from 'react';
import ResumeDiv from './ResumeDiv';

const resume = () => {
  return (
    <div className='container'>
      <div className="route resume resume-para">
        <ResumeDiv h1='Shivam Sharma' h3='Software Developer' h5='summary' p='Seeking a position in an organisation focused on making human centric products with data driven decisions. With mentality to learn at each step, technical education along with diverse experience of working full-stack developer in an agile culture, I aim to deliver my best with productive outcomes.'/>
        {/* <h1>Shivam Sharma</h1>
        <h3>Software Developer </h3>
        <h5>summary</h5>
        <p className=''>Seeking a position in an organisation focused on making human centric products with data driven decisions. With mentality to learn at each step, technical education along with diverse experience of working full-stack developer in an agile culture, I aim to deliver my best with productive outcomes.</p> */}
        <ResumeDiv h5='experience' pre='Jan 2018 - July 2018 (Full-Time)' p='Worked as Front-End Developer with a team of developers, managers in an agile environment to solve problems for web .' />
        {/* <h5>experience</h5>
        <p className=''>Jan 2018 - July 2018 (Full-Time)</p>
        <p>Worked as Front-End Developer with a team of developers, managers in an agile environment to solve problems for web .</p> */}
        <ResumeDiv h5='education' h3='B.E in Information Technology' h5='U.I.E.T, Panjab University, Chandigarh' p='July 2014 - June 2018 (Full-Time)' p='Working knowledge of various languages helps me taking major decision in feasibilty and shaping the architecture. The education helps me in perceiving a developer’s point of view while approaching a problem.' />
        {/* <h5>education</h5>
        <h3>B.E in Information Technology</h3>
        <h5>U.I.E.T, Panjab University, Chandigarh</h5>
        <p>July 2014 - June 2018 (Full-Time)</p>
        <p>Working knowledge of various languages helps me taking major decision in feasibilty and shaping the architecture. The education helps me in perceiving a developer’s point of view while approaching a problem.</p> */}
        <ResumeDiv h5='competencies' />
        <h5>competencies</h5>
        <p>1. C++</p>
        <p>2. Data Structures</p>
        <p>3. Algorithms</p>
        <p>4. HTML</p>
        <p>5. CSS</p>
        <p>6. JavaScript</p>
        <p>7. BootStrap 4</p>
        <p>8. ReactJS</p>
      </div>
    </div>
  );
}

export default resume;
